import React from 'react';
import "./App.css";
import "bootstrap/dist/css/bootstrap.min.css";
import { Container } from "react-bootstrap";
import PublicNavBar from './components/PublicNavBar';

const App = () => {
  return (
    <div className="text-center">
      <PublicNavBar/>
      <Container>
        <h1>My new React App</h1>
      </Container>
    </div>
  )
}

export default App
